import React from 'react';
import { Card, CardContent } from '../components/Card';
import { Button } from '../components/Button';

export default function NewInCanadaChecklist() {
  const categories = [
    {
      title: 'üõ¨ Immediately After Arrival',
      items: [
        'Go through immigration & collect your permit',
        'Buy a Canadian SIM card',
        'Get local currency (CAD)',
        'Use free airport WiFi to contact family or arrange pickup'
      ]
    },
    {
      title: 'üè† Temporary Stay / Housing',
      items: [
        'Stay with friends or booked Airbnb/hostel',
        'Search for shared rooms or apartments',
        'Be cautious of rental scams'
      ]
    },
    {
      title: 'ü™™ Essential Documents Setup',
      items: [
        'Apply for SIN (Social Insurance Number)',
        'Open a bank account',
        'Register for a mobile plan',
        'Apply for a provincial health card'
      ]
    },
    {
      title: 'üí≥ Daily Life Setup',
      items: [
        'Get a public transit card (e.g. Presto, Compass)',
        'Buy warm clothes if needed',
        'Visit grocery stores (Walmart, No Frills, Nepali stores)'
      ]
    },
    {
      title: 'üéì Student Tasks',
      items: [
        'Register with college/university',
        'Get student ID',
        'Check health insurance coverage',
        'Understand PGWP eligibility'
      ]
    },
    {
      title: 'üíº Worker / Job Seeker Tasks',
      items: [
        'Apply for part-time jobs',
        'Create a Canadian-style resume',
        'Check Indeed, Job Bank, LinkedIn',
        'Be careful with cash job offers'
      ]
    },
    {
      title: 'üß† Learn About Canadian Systems',
      items: [
        'Know your worker rights',
        'Learn about taxes and filing returns',
        'Understand tenant rights'
      ]
    },
    {
      title: 'ü§ù Connect with Nepali Community',
      items: [
        'Join Nepali WhatsApp/FB/Telegram groups',
        'Attend cultural meetups',
        'Volunteer or join Nepali organizations'
      ]
    },
    {
      title: 'üßæ Legal & Immigration Help',
      items: [
        'Keep copies of visa/permit/letters',
        'Track permit expiry dates',
        'Explore PR pathways early',
        'Consult licensed immigration consultants only'
      ]
    },
    {
      title: 'üÜò Emergency Info',
      items: [
        '911 ‚Äì Emergencies',
        '811 ‚Äì Medical help',
        'Community help lines if overwhelmed'
      ]
    }
  ];

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-4 text-center">üÜï Newcomers to Canada Checklist</h1>
      <p className="text-center text-gray-600 mb-8">
        Here's everything you need to do as a newcomer ‚Äî step-by-step.
      </p>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {categories.map((category, index) => (
          <Card key={index} className="bg-white rounded-xl shadow">
            <CardContent className="p-4">
              <h2 className="text-xl font-semibold mb-2">{category.title}</h2>
              <ul className="list-disc pl-5 text-gray-700 space-y-1">
                {category.items.map((item, idx) => (
                  <li key={idx}>{item}</li>
                ))}
              </ul>
            </CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
}
